import logo from '../images/logo.png';
import {Link} from "react-router-dom";
import {useState} from 'react';


function MainNavbar() {

  const [isHome, setIsHome] = useState(true);
  const [isAbout, setIsAbout] = useState(false);
  const [isProducts, setIsProducts] = useState(false);
  const [isEvents, setIsEvents] = useState(false);
  const [isContact, setIsContact] = useState(false);

  
  const handleHomeClick = event => {
    setIsHome(true);
    setIsAbout(false);
    setIsProducts(false);
    setIsEvents(false);
    setIsContact(false);
  };

  const handleAboutClick = event => {
    setIsHome(false);
    setIsAbout(true);
    setIsProducts(false);
    setIsEvents(false);
    setIsContact(false);
  };

  const handleProductsClick = event => {
    setIsHome(false);
    setIsAbout(false);
    setIsProducts(true);
    setIsEvents(false);
    setIsContact(false);
  };

  const handleEventsClick = event => {
    setIsHome(false);
    setIsAbout(false);
    setIsProducts(false);
    setIsEvents(true);
    setIsContact(false);
  };

  const handleContactClick = event => {
    setIsHome(false);
    setIsAbout(false);
    setIsProducts(false);
    setIsEvents(false);
    setIsContact(true);
  };


  return (
    <>
      <nav className="navbar navbar-expand-lg bg-body-light">
        <div className="container">
          <a className="navbar-brand" href="#home"><img className="logo" src={logo} alt="logo"/></a>
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <Link className={`nav-link ${isHome ? 'active' : ''}`} aria-current="page" to="/" onClick={handleHomeClick}> Home </Link>
              </li>
              <li className="nav-item">
                <Link className={`nav-link ${isAbout ? 'active' : ''}`} to="/about" onClick={handleAboutClick}> About us </Link>
              </li>
              <li className="nav-item">
                <Link className={`nav-link ${isProducts ? 'active' : ''}`} to="/products" onClick={handleProductsClick}> Our products </Link>
              </li>
              <li className="nav-item">
                <a className={`nav-link ${isEvents ? 'active' : ''}`} href="#events" onClick={handleEventsClick}>Events</a>
              </li>
              <li className="nav-item">
                <a className={`nav-link ${isContact ? 'active' : ''}`} href="#contactus" onClick={handleContactClick}>Contact us</a>
              </li>
            </ul>
            <form className="d-flex" role="search">
              <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
              <button className="btn btn-outline-success" type="submit">Search</button>
            </form>
          </div>
        </div>
      </nav>
      </>
  );
}

export default MainNavbar;
